美白保護・肌ケアに<br>UVカット！お手軽カーテン<br><br>女性にオススメ！<br>有害な紫外線からお肌を守るお手軽スキンケア！<br><br><br>●車内からの視認性に優れたメッシュ生地<br>●吸盤で窓に貼り付けるだけの超簡単取り付け<br>●ゴムバンド付なのでカーテンが伸縮自在<br>●吸盤が3箇所付いていますので中央部が垂れることがなく窓の形に添ってスッキリ取付けが可能<br>●未使用時は小さくたたんで収納<br>●工具不要で取り付けることが可能<br><br><br>■仕様<br>商品サイズ：(W)約700mm x (H)約520mm【Mサイズ】<br>入数：2枚セット<br><br>メーカー名：ミラリード/secret ZONE<br>メーカー品番：B89-410<style type="text/css">
